import React from 'react';
import { useForm } from 'react-hook-form';
import { Controller } from 'react-hook-form';
import styles from './styles/SortByProps.module.scss';

type Inputs = {
    example: string
    exampleRequired: string
}

const SortByProps = () => {
    const {
        register,
        handleSubmit,
        control,
        formState: { errors },
    } = useForm()

    const sendProps = () => {

    };

    const changeHandler = () => {

    };

    return (
        <form className={styles.block} onSubmit={handleSubmit(sendProps)}>
            <h2 className={styles.title}>По свету</h2>
                <div className={styles.inputs}>
                    <label className={styles.label}>
                        <div className={styles.fakeCheckbox}></div>
                        <Controller
                            name="exampleField"
                            control={control}
                            defaultValue=""
                            render={({ field }) => (
                            <input
                                type="checkbox"
                                {...field}
                            />
                            )}
                        />
                        <input className={styles.checkbox} type={'checkbox'} {...register("Light", {
                            // checked: true/false,
                            onChange: changeHandler,
                        })}/>
                    </label>
                    <label className={styles.label}>
                        <div className={styles.fakeCheckbox}></div>
                        <input className={styles.checkbox} type={'checkbox'} {...register("Light", {required: false})}/>
                    </label>
                    <label className={styles.label}>
                        <div className={styles.fakeCheckbox}></div>
                        <input className={styles.checkbox} type={'checkbox'} {...register("Light", {required: false})}/>
                    </label>
                </div>
            <h2 className={styles.title}>Пo цвету</h2>
                    <label className={styles.label}>
                        <div className={styles.fakeCheckbox}></div>
                        <input className={styles.checkbox} type={'checkbox'} {...register("Light", {required: false})}/>
                    </label>
                    <label className={styles.label}>
                        <div className={styles.fakeCheckbox}></div>
                        <input className={styles.checkbox} type={'checkbox'} {...register("Light", {required: false})}/>
                    </label>
            
            <h2 className={styles.title}>По формату</h2>
                    <label className={styles.label}>
                        <div className={styles.fakeCheckbox}></div>
                        <input className={styles.checkbox} type={'checkbox'} {...register("Light", {required: false})}/>
                    </label>
                    <label className={styles.label}>
                        <div className={styles.fakeCheckbox}></div>
                        <input className={styles.checkbox} type={'checkbox'} {...register("Light", {required: false})}/>
                    </label>
            
            <h2 className={styles.title}>стоимость</h2>
                    <label className={styles.label}>
                        <div className={styles.fakeCheckbox}></div>
                        <input className={styles.checkbox} type={'checkbox'} {...register("Light", {required: false})}/>
                    </label>
                    <label className={styles.label}>
                        <div className={styles.fakeCheckbox}></div>
                        <input className={styles.checkbox} type={'checkbox'} {...register("Light", {required: false})}/>
                    </label>
            
            <h2 className={styles.title}>По цветку</h2>
                    <label className={styles.label}>
                        <div className={styles.fakeCheckbox}></div>
                        <input className={styles.checkbox} type={'checkbox'} {...register("Light", {required: false})}/>
                    </label>
                    <label className={styles.label}>
                        <div className={styles.fakeCheckbox}></div>
                        <input className={styles.checkbox} type={'checkbox'} {...register("Light", {required: false})}/>
                    </label>
        </form>
    );
};

export default SortByProps;
